	public AlyOCRData orcId(String disorderid, String basePic, String side) throws Exception {
		
		String host = "http://dm-51.data.aliyun.com";
        String path = "/rest/160601/ocr/ocr_idcard.json";
        String method = "POST";  // 请求类型POST
        String appcode = "c06aadd9e5de4eaa9ae1aab8772bb25f"; // 产品密钥
        Boolean is_old_format = false;
        JSONObject configObj = new JSONObject();
        configObj.put("side", side);
        String config_str = configObj.toString();
        Map<String, String> headers = new HashMap<String, String>();
        headers.put("Authorization", "APPCODE " + appcode);
        headers.put("Content-Type", "application/json; charset=UTF-8");
        Map<String, String> querys = new HashMap<String, String>();
        JSONObject requestObj = new JSONObject();
        if(is_old_format) {
            JSONObject obj = new JSONObject();
            obj.put("image", getParam(50, basePic));
            if(config_str.length() > 0) {
                obj.put("configure", getParam(50, config_str));
            }
            JSONArray inputArray = new JSONArray();
            inputArray.add(obj);
            requestObj.put("inputs", inputArray);
        }else{
            requestObj.put("image", basePic);
            if(config_str.length() > 0) {
                requestObj.put("configure", config_str);
            }
        }    
        
        String bodys = requestObj.toString();
        logger.info("商户订单号："+disorderid+",请求报文："+bodys);
        HttpResponse result = HttpUtils2.doPost(host, path, method, headers, querys, bodys);
        JSONObject json = JSONObject.parseObject(EntityUtils.toString(result.getEntity()));
        logger.info("商户订单号："+disorderid+"，返回报文："+json.toString());
		AlyOCRData response = new AlyOCRData();
		if(json.getBoolean("success")) {
	    	response.setState("00");
	    	response.setResult(json.toString());
	    } else {
	    	response.setState("01");
	    	response.setMsg("认证失败！");
	    }
		
		return response;
	}
	
